    private double[] evaluate_layer1(Layer1 layer, double[] x) {
        // return 64 elements
        int rows = layer.weight.length;
        int columns = layer.weight[0].length;

        double[][] transposedWeight = new double[columns][rows];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < columns; j++) {
                transposedWeight[j][i] = layer.weight[i][j];
            }
        }

        double[] product = productRowsColumn(transposedWeight, x);

        double n[] = new double[product.length];
        double a[] = new double[product.length];
        for(int i = 0; i < product.length; i++) {
            n[i] = layer.b[i] + product[i];
            a[i] = Math.max(0, n[i]);
        }

        return a;
    }

    private double[] evaluate_layer2(Layer2 layer, double[] x) {
        // return 64 elements

        int rows = layer.weight.length;
        int columns = layer.weight[0].length;

        double[][] transposedWeight = new double[columns][rows];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < columns; j++) {
                transposedWeight[j][i] = layer.weight[i][j];
            }
        }
        double[] product = productRowsColumn(transposedWeight, x);

        double n[] = new double[product.length];
        double a[] = new double[product.length];
        for(int i = 0; i < product.length; i++) {
            n[i] = layer.b[i] + product[i];
            a[i] = Math.max(0, n[i]);
        }

        return a;
    }

    private double[] evaluate_layer3(Layer3 layer, double[] x) {
        // return 64 elements
        int rows = layer.weight.length;
        int columns = layer.weight[0].length;

        double[][] transposedWeight = new double[columns][rows];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < columns; j++) {
                transposedWeight[j][i] = layer.weight[i][j];
            }
        }

        double[] product = productRowsColumn(transposedWeight, x);

        double a[] = new double[product.length];
        for(int i = 0; i < product.length; i++) {
            a[i] = layer.b[i] + product[i];
        }

        return a;
    }

    private double[] productRowsColumn(double[][] a, double[] b) {

        double result[] = new double[a.length];

        // loop over rows of a
        for(int i=0; i < a.length; i++) {
            double rowSum = 0;
            for(int j=0; j < b.length; j++) {
                rowSum = rowSum + (a[i][j] * b[j]);
            }
            result[i] = rowSum;
        }

        return result;
    }


    public float computeOmega(float mean_theta, float var_theta, float omega) {

        float u = 0;
        if (!Double.isNaN(mean_theta)) {
            double[] currentState = new double[] {mean_theta, var_theta, omega};
            double[] a1 = evaluate_layer1(layer1, currentState);
            double[] a2 = evaluate_layer2(layer2, a1);
            double[] y1 = evaluate_layer3(layer3, a2);

            int maxIndex = 0;
            for(int i = 1; i < y1.length; i++) {
                if(y1[i] > y1[maxIndex]) {
                    maxIndex = i;
                }
            }
            u = actions[maxIndex];
        }
        else {
            u = 0;
        }

        int omega_max = 15;
        int omega_min = -15;
        float omega_a = omega + u;
        if (omega_a > omega_max)
            omega_a = omega_max;
        else if (omega_a < omega_min) {
            omega_a = omega_min;
        }

        return omega_a;
    }


